  if (!vino) {
    return <p>No se ha seleccionado ning√∫n vino.</p>;
  }

  return (
    <div>
      <h2>Detalles del Vino</h2>
      <p><strong>Nombre:</strong> {vino.nombre}</p>
      <p><strong>Tipo:</strong> {vino.tipo}</p>
    </div>
  );
};

export default VinoDetail;
